function readyModal() {
	//GLOBAL MODAL CONFIG
	$(".modal-trigger").off("click");
	$(".modal-trigger").click(function() {
		if ($(this).data("ht") != null) {
			$(".modal-title").html($(this).data("ht"));
		} else {
			$(".modal-title").html($(this).text());
		}

		if (!$(this).data('bt')){
			var rh = $(this).data('rh');

			var xhttp = new XMLHttpRequest();
	  		xhttp.onreadystatechange = function() {
	    		if (this.readyState == 4 && this.status == 200) {
	    			var data = JSON.parse(this.responseText);
					$(".modal-footer").html(data["footer_html"]);
					//Now we got Modal Footer data load modal content which will estab,ish button fucxntions
					var xhttp = new XMLHttpRequest();
	  				xhttp.onreadystatechange = function() {
	    				if (this.readyState == 4 && this.status == 200) {
							$(".modal-body").html(this.responseText);
						} else {
							print("Content Unavailable at Modal Process 2");
						}
	  				};
	  				xhttp.open("GET", "remote-html.php?do="+rh, true);
	  				xhttp.send();
				} else {
					$(".modal-footer").html('<!--<span class="btn btn-danger disabled">Error loading button tips</span>--><button type="button" class="btn btn-default" data-dismiss="modal">Close</button>');
					print("Content Unavailable at Modal Process 1");
				}



	  		};

	  		xhttp.open("GET", "remote-json.php?do="+$(this).data('rh')+"&intent=setup", true);
	  		xhttp.send();
		} else {
			$(".modal-body").html($(this).data('bt'));
			$(".modal-footer").html('<button type="button" class="btn btn-default" data-dismiss="modal">Close</button>');

		}


  		//----------




	});
}

function print(s) {
	console.log(s);
}

function chkSesh() {
		showWaiting('Getting things ready...');
		var xhttp = new XMLHttpRequest();
  		xhttp.onreadystatechange = function() {
    		if (this.readyState == 4 && this.status == 200) {
    			var data = JSON.parse(this.responseText);
				if (data["status_code"] == "error") {
					$('body').html("");
					window.location.href = "index.php?do=user.logout&reason=timeout";
				}
				hideWaiting();
			}
  		};
  		xhttp.open("GET", "remote-json.php?do=user.login&intent=check&inc=true", true);
  		xhttp.send();
}

function armTooltips() {
	$('[data-toggle="tooltip"]').tooltip();
}

function armSearchBar() {

	$(document).on('click','#searchbar_go',function(){
    	window.location.href = "index.php?do=sebs.manage.users&query="+$("#searchbar").val();
	});
}

function ZAPlaxImg(){

	var d = document,
		de = d.documentElement,
		bd = d.getElementsByTagName('body')[0],
		htm = d.getElementsByTagName('html')[0],
		win = window,
		imgs = d.querySelectorAll('.ZAPlaxImg'),
		totalImgs = imgs.length,
		supportsTouch = 'ontouchstart' in win || navigator.msMaxTouchPoints;

	if(totalImgs <= 0){
		return;
	}

	// build HTML
	for(var l=0;l<totalImgs;l++){

		var thisImg = imgs[l],
			layerElems = thisImg.querySelectorAll('.ZAPlaxImg-layer'),
			totalLayerElems = layerElems.length;

		if(totalLayerElems <= 0){
			continue;
		}

		while(thisImg.firstChild) {
			thisImg.removeChild(thisImg.firstChild);
		}

		var containerHTML = d.createElement('div'),
			shineHTML = d.createElement('div'),
			shadowHTML = d.createElement('div'),
			layersHTML = d.createElement('div'),
			layers = [];

		thisImg.id = 'ZAPlaxImg__'+l;
		containerHTML.className = 'ZAPlaxImg-container';
		shineHTML.className = 'ZAPlaxImg-shine';
		shadowHTML.className = 'ZAPlaxImg-shadow';
		layersHTML.className = 'ZAPlaxImg-layers';

		for(var i=0;i<totalLayerElems;i++){
			var layer = d.createElement('div'),
				imgSrc = layerElems[i].getAttribute('data-img');

			layer.className = 'ZAPlaxImg-rendered-layer';
			layer.setAttribute('data-layer',i);
			layer.style.backgroundImage = 'url('+imgSrc+')';
			layersHTML.appendChild(layer);

			layers.push(layer);
		}

		containerHTML.appendChild(shadowHTML);
		containerHTML.appendChild(layersHTML);
		containerHTML.appendChild(shineHTML);
		thisImg.appendChild(containerHTML);

		var w = thisImg.clientWidth || thisImg.offsetWidth || thisImg.scrollWidth;
		thisImg.style.transform = 'perspective('+ w*3 +'px)';

		if(supportsTouch){
			win.preventScroll = false;

	        (function(_thisImg,_layers,_totalLayers,_shine) {
				thisImg.addEventListener('touchmove', function(e){
					if (win.preventScroll){
						e.preventDefault();
					}
					processMovement(e,true,_thisImg,_layers,_totalLayers,_shine);
				});
	            thisImg.addEventListener('touchstart', function(e){
	            	win.preventScroll = true;
					processEnter(e,_thisImg);
				});
				thisImg.addEventListener('touchend', function(e){
					win.preventScroll = false;
					processExit(e,_thisImg,_layers,_totalLayers,_shine);
				});
	        })(thisImg,layers,totalLayerElems,shineHTML);
	    } else {
	    	(function(_thisImg,_layers,_totalLayers,_shine) {
				thisImg.addEventListener('mousemove', function(e){
					processMovement(e,false,_thisImg,_layers,_totalLayers,_shine);
				});
	            thisImg.addEventListener('mouseenter', function(e){
					processEnter(e,_thisImg);
				});
				thisImg.addEventListener('mouseleave', function(e){
					processExit(e,_thisImg,_layers,_totalLayers,_shine);
				});
	        })(thisImg,layers,totalLayerElems,shineHTML);
	    }
	}

	function processMovement(e, touchEnabled, elem, layers, totalLayers, shine){

		var bdst = bd.scrollTop || htm.scrollTop,
			bdsl = bd.scrollLeft,
			pageX = (touchEnabled)? e.touches[0].pageX : e.pageX,
			pageY = (touchEnabled)? e.touches[0].pageY : e.pageY,
			offsets = elem.getBoundingClientRect(),
			w = elem.clientWidth || elem.offsetWidth || elem.scrollWidth, // width
			h = elem.clientHeight || elem.offsetHeight || elem.scrollHeight, // height
			wMultiple = 320/w,
			offsetX = 0.52 - (pageX - offsets.left - bdsl)/w, //cursor position X
			offsetY = 0.52 - (pageY - offsets.top - bdst)/h, //cursor position Y
			dy = (pageY - offsets.top - bdst) - h / 2, //@h/2 = center of container
			dx = (pageX - offsets.left - bdsl) - w / 2, //@w/2 = center of container
			yRotate = (offsetX - dx)*(0.07 * wMultiple), //rotation for container Y
			xRotate = (dy - offsetY)*(0.1 * wMultiple), //rotation for container X
			imgCSS = 'rotateX(' + xRotate + 'deg) rotateY(' + yRotate + 'deg)', //img transform
			arad = Math.atan2(dy, dx), //angle between cursor and center of container in RAD
			angle = arad * 180 / Math.PI - 90; //convert rad in degrees

		//get angle between 0-360
		if (angle < 0) {
			angle = angle + 360;
		}

		//container transform
		if(elem.firstChild.className.indexOf(' over') != -1){
			imgCSS += ' scale3d(1.07,1.07,1.07)';
		}
		elem.firstChild.style.transform = imgCSS;

		//gradient angle and opacity for shine
		shine.style.background = 'linear-gradient(' + angle + 'deg, rgba(255,255,255,' + (pageY - offsets.top - bdst)/h * 0.4 + ') 0%,rgba(255,255,255,0) 80%)';
		shine.style.transform = 'translateX(' + (offsetX * totalLayers) - 0.1 + 'px) translateY(' + (offsetY * totalLayers) - 0.1 + 'px)';

		//parallax for each layer
		var revNum = totalLayers;
		for(var ly=0;ly<totalLayers;ly++){
			layers[ly].style.transform = 'translateX(' + (offsetX * revNum) * ((ly * 2.5) / wMultiple) + 'px) translateY(' + (offsetY * totalLayers) * ((ly * 2.5) / wMultiple) + 'px)';
			revNum--;
		}
	}

	function processEnter(e, elem){
		elem.firstChild.className += ' over';
	}

	function processExit(e, elem, layers, totalLayers, shine){

		var container = elem.firstChild;

		container.className = container.className.replace(' over','');
		container.style.transform = '';
		shine.style.cssText = '';

		for(var ly=0;ly<totalLayers;ly++){
			layers[ly].style.transform = '';
		}

	}

}

$(document).ready(function(){
	readyModal();
	chkSesh();
	armTooltips();
	armSearchBar();
});

